import axios from 'axios';
import React, { useState } from 'react'
import MiniModalLeft from './components/MiniModalLeft';
import MiniModalRight from './components/MiniModalRight';

const Register = () => {

    const [inputs, setInputs] = useState({});

    const [nameError, setNameError] = useState();
    const [lastError, setLastError] = useState();
    const [emailError, setEmailError] = useState();
    const [usernameError, setUsernameError] = useState();
    const [contactError, setContactError] = useState();
    const [passwordError, setPasswordError] = useState();
    const [passwordConError, setPasswordConError] = useState();

    const handleChange = (e) => {
        const name = e.target.name;
        const value = e.target.value;
        setInputs(values => ({...values, [name]: value}));

        console.log(inputs);

        if(inputs.last.length === 0){
            setLastError(<MiniModalRight message="Try that again..."/>);
           } else {
            setLastError();
           }

           if(inputs.first.length === 0){
            setNameError(<MiniModalLeft message="We need that name..."/>);
           } else {
            setNameError();
           }


           if(inputs.email.length === 0){
            setEmailError(<MiniModalLeft message="Get it right crhistintah!"/>);
           } else {
            setEmailError();
           }

           if(inputs.username === undefined){
            setUsernameError(<MiniModalLeft message="You need a Username"/>);
           } else {
            setUsernameError();
           }

           if(inputs.contact === undefined){
            setContactError(<MiniModalRight message="Number... Chop, Chop"/>);
           } else {
            setContactError();
           }

           if(inputs.password === undefined){
            setPasswordError(<MiniModalLeft message="This ones important"/>);
           } else {
            setPasswordError();
           }

           if(inputs.passwords != inputs.conPass){
            setPasswordConError(<MiniModalLeft message="Your Passwords do not match"/>);
           } else {
            setPasswordConError();
           }



    }



    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(inputs);

        const isEmpty = Object.keys(inputs).length === 0;

       if(isEmpty === true){
           setNameError(<MiniModalLeft message="You Have a Name Right?"/>);
           setLastError(<MiniModalRight message="Try that again..."/>);
           setEmailError(<MiniModalLeft message="You Must Enter An Email?"/>);
           setUsernameError(<MiniModalLeft message="Choose A Username?"/>);
           setPasswordError(<MiniModalLeft message="Please Enter A Password?"/>);
           setContactError(<MiniModalRight message="Give us your soul"/>);
       } 

       if(inputs.last === undefined ){
        setLastError(<MiniModalRight message="Try that again..."/>);
       } else {
        setLastError();
       }

       if(inputs.first === undefined){
        setNameError(<MiniModalLeft message="We need that name..."/>);
       } else {
        setNameError();
       }


       if(inputs.email === undefined){
        setEmailError(<MiniModalLeft message="Get it right crhistintah!"/>);
       } else {
        setEmailError();
       }

       if(inputs.username === undefined){
        setUsernameError(<MiniModalLeft message="You need a Username"/>);
       } else {
        setUsernameError();
       }

       if(inputs.contact === undefined){
        setContactError(<MiniModalRight message="Number... Chop, Chop"/>);
       } else {
        setContactError();
       }

       if(inputs.passwords === undefined){
        setPasswordError(<MiniModalLeft message="This ones important"/>);
       } else {
        setPasswordError();
       }

       if(inputs.passwords != inputs.conPass){
        setPasswordConError(<MiniModalLeft message="Your Passwords do not match"/>);
       } else {
        setPasswordConError();
       }










        // axios.post('http://localhost:8888/api/addUser', inputs)
        // .then(function(response){
        //     console.log(response);
        // });
    }

  return (
    <div>
        <form>
            <h1>Sign Up to FakeBook</h1>
            <p>Give us all that sweet sweet data!</p>

            <div className='names'>
                {nameError}
                <input name="first" className='left' type="text" placeholder='First Name' onChange={handleChange} />
                {lastError}
                <input name='last' type="text" placeholder='Last Name'onChange={handleChange}  />
            </div>
            {emailError}
            <input name="email" type="email" placeholder='Your Email' onChange={handleChange} />
            <div className='userCon'>
               {usernameError}
                <input name="username" className='left' type="username" placeholder='Select A Username' onChange={handleChange}/>
                {contactError}
                <input name="contact" type="contact" placeholder='Contact Number' onChange={handleChange}/>
            </div>
            <div className='passCon'>
                {passwordError}
                <input name="password" type="password" placeholder='Choose A Password' onChange={handleChange}/>
                {passwordConError}
                <input name="conPass" type="password" placeholder='Confirm Password' onChange={handleChange}/>
            </div>
            <button type="submit" onClick={handleSubmit}>Take My Data Lizard Man!</button>
        </form>

    </div>
  )
}

export default Register
